import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selectPage: true,
    };
  }
  render() {
    console.log(this.props.sel);
    return (
      <div>
        <div>{this.state.selectPage ? <Users /> : <Play />}</div>
      </div>
    );
  }
}

export default App;
